import img1 from '../assets/1.png';
import img2 from '../assets/2.png';
import img3 from '../assets/3.png';
import img4 from '../assets/4.png';

export const data = [
    {
        id: img1,
        image: `${1}`,
        name: 'Producto 1',
        description: 'Producto 2',
        quantity: 1,
    },
    {
        id: img2,
        image: `${2}`,
        name: 'Producto 2',
        description: 'Producto 3',
        quantity: 1,
    },
    {
        id: img3,
        image: `${3}`,
        name: 'Producto 2',
        description: 'Producto 3',
        quantity: 1,
    },
    {
        id: img4,
        image: `${4}`,
        name: 'Producto 2',
        description: 'Producto 3',
        quantity: 1,
    }
]
